import React, { Component } from 'react';
import NavDropdown from 'react-bootstrap/Nav';
import '../../scss/navbar.scss';

export default class NavbarDropdown extends Component {
  render() {
    return (
      <NavDropdown
        title="Browse"
        id="collasible-nav-dropdown"
        className="mx-1"
      >
        <NavDropdown.Item as={Link} to="/action">
          Action
      </NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item as={Link} to="/indie">
          Indie
      </NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item as={Link} to="/adventure">
          Adventure
      </NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item as={Link} to="/rpg">
          RPG
      </NavDropdown.Item>
      </NavDropdown>
    )
  }
}
